import React, { Fragment } from 'react'
import {FacebookIcon, GoogleIcon} from '@mui/icons-material';
import '../css/Home.css'


function Home() {
  return (
    <Fragment>
          <section id='home' className='pd-y'>
        <div className='container'> 
        <div className="row">
            <div className="col-md-6 col-12 home-text">
                <h1>beta academy</h1>
                <p>training center that aims to develop student's skills in technical and non-technical in all engineering fields.</p>
                <div className='social-icons'>
                  <FacebookIcon className='icon fb'></FacebookIcon>
                </div>
            </div> {/* ./home-text */}
            <div className='col-md-5 col-12 home-img'></div> {/* ./img */}
        </div> {/* ./row */}
        </div> {/*./container */}
    </section>
    {/* ./home */}
    <div className="divider"></div>
    <section className="courses text-center mt-5 pd-y">
      <div className="container">
      <h1> courses will be here !!  </h1>
      </div>
    </section>
    {/* ./courses */}
    </Fragment>
  )
}

export default Home
